declare const _default: "\n<h2>{{name}} ver. {{version}}</h2>  \n<strong>author:</strong> {{author.name}}  \n<p>{{{description}}}</p>\n\n{{#homepage}}\n<h3>Home page</h3>\n<a href=\"{{homepage}}\">{{homepage}}</a>\n{{/homepage}}\n\n{{#repository}}\n<h3>Repository</h3>\n<a href=\"{{repository.url}}\">{{repository.url}}</a>\n{{/repository}}\n\n{{#docs}}\n<h3>Documentation</h3>\n<a href=\"{{docs}}\">{{docs}}</a>\n{{/docs}}\n\n{{#install}}\n<h3>Installation</h3>\n<pre><code>{{install}}</pre></code>\n{{/install}}\n\n{{#examples.length}}\n<h3>Examples</h3>\n{{#examples}}\n<pre><code>{{{.}}}</code></pre>\n{{/examples}}\n{{/examples.length}}\n\n{{#dependencies.length}}\n<h3>Dependencies</h3>\n<ul>\n{{#dependencies}}\n<li><a href=\"https://www.npmjs.com/package/{{name}}\">{{name}}: {{version}}</a> {{{description}}} {{#author}}(by <a href=\"{{url}}\">{{name}}</a>){{/author}}</li>\n{{/dependencies}}\n</ul>\n{{/dependencies.length}}\n\n{{#devDependencies.length}}\n<h3>devDependencies</h3>\n<ul>\n{{#devDependencies}}\n<li><a href=\"https://www.npmjs.com/package/{{name}}\">{{name}}: {{version}}</a> {{{description}}} {{#author}}(by <a href=\"{{url}}\">{{name}}</a>){{/author}}</li>\n{{/devDependencies}}\n</ul>\n{{/devDependencies.length}}\n\n{{#todo.length}}\n<h3>Todo</h3>\n<ul>\n{{#todo}}<li>{{{.}}}</li>{{/todo}}\n</ul>\n{{/todo.length}}\n\n{{#contributors.length}}\n<h3>Contributors</h3>\n<ul>\n{{#contributors}}\n<li>{{#url}}<a href=\"{{url}}\">{{name}}</a>{{/url}}{{^url}}{{name}}{{/url}}</li>\n{{/contributors}}\n</ul>\n{{/contributors.length}}\n";
export default _default;
